import React from 'react';

const NotFound = () => {
  return (
    <div>
      <p
        style={{
          textAlign: 'center',
          color: 'gray',
          fontSize: '25px',
          margin: '25px',
        }}
      >
        {' '}
        Page Page Not Found
      </p>
    </div>
  );
};

export default NotFound;
